import { BrowserRouter, Switch, Route } from "react-router-dom";
import Home from "./pages/Home";
import Signup from "./pages/Home";
import Login from "./pages/Login";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Switch> 
        <Route>
        <Home />
        </Route>
      </Switch>
        <Signup />
        <Login />
      </BrowserRouter>
    </div>
  );
}

export default App;
